--
-- Table structure for table `tb_dept`
--

DROP TABLE IF EXISTS `tb_dept`;
CREATE TABLE `tb_dept` (
  `id` decimal(8,0) NOT NULL,
  `domain` decimal(13,0) default '32',
  `code` varchar(64) default '',
  `name` varchar(64) NOT NULL,
  `manager` varchar(64) default NULL,
  `phone_no` varchar(24) default NULL,
  `fax_no` varchar(24) default NULL,
  `address` varchar(512) default NULL,
  `postcode` varchar(6) default NULL,
  `rank` varchar(4) default '' COMMENT '1：司法所；2：区司法局；3：市司法局；4：其他',
  `description` varchar(300) default NULL COMMENT '描述',
  `upper_dept` decimal(8,0) default NULL COMMENT '没有上级机构时为null',
  `node` varchar(40) NOT NULL default 'X',
  `view_order` int(6) default NULL COMMENT '显示顺序',
  `use_flag` decimal(1,0) NOT NULL default '1',
  `insert_date` timestamp NOT NULL default CURRENT_TIMESTAMP,
  `insert_id` decimal(8,0) NOT NULL,
  `update_date` timestamp NOT NULL default '0000-00-00 00:00:00',
  `update_id` decimal(8,0) default NULL,
  `dept_id` decimal(8,0) default NULL,
  `longitude` decimal(9,6) default NULL COMMENT '经度',
  `latitude` decimal(9,6) default NULL COMMENT '纬度',
  `organization_type_id` bigint(20) default NULL COMMENT '机构类型Id',
  `jgbm` varchar(30) default NULL COMMENT '机构编码',
  `uvalue` decimal(10,2) default '0.00',
  `fvalue` decimal(10,2) default '0.00',
  `svalue` decimal(10,2) default '100.00',
  `f1` float default '0',
  `f2` float default '0',
  `f3` float default '0',
  `f4` float default '0',
  PRIMARY KEY  (`id`),
  KEY `FK_Reference_1` (`domain`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

